import React, { Component } from 'react';

class Cards extends Component {
  render() {
    return (
      <div className="container">
        <div className="row">
          <div className="col-sm-12 col-md-8 col-lg-6">

              <form className="text-center border border-light p-5">
                <p className="h4 mb-4">Create New Business Trip Group</p>
                <input type="email" id="groupname" className="form-control mb-4" placeholder="Group Name" />
                <button className="btn btn-info btn-block my-4" type="submit">Create Group</button>
              </form>

          </div>
        </div>
      </div>
    );
  }
}

export default Cards;
